/**
 * 1759. Count Number of Homogenous Substrings
 *
 * @param {string} s
 * @return {number}
 */
var countHomogenous = function (s) {
    const mod = 10 ** 9 + 7;
    let len = s.length;
    let result = 0;

    let prev = s[0];
    let count = 1;
    for (let i = 1; i < len; i++) {
        if (s[i] === prev) {
            count++;
        } else {
            result += ((count * (count + 1)) / 2) % mod;
            prev = s[i];
            count = 1;
        }
    }
    result += ((count * (count + 1)) / 2) % mod;
    return result % mod;
};

console.log(countHomogenous("abbcccaa"));
console.log(countHomogenous("xy"));
console.log(countHomogenous("zzzzz"));
console.log(
    countHomogenous(
        ""
    )
);
